  p_qp.sp_a = casadi_s0;
  p_qp.sp_h = casadi_s1;
  casadi_qp_setup(&p_qp);
  casadi_qp_init(&d_qp, &iw, &w);
  d_qp.h = arg[0];
  d_qp.g = arg[1];
  d_qp.a = arg[2];
  d_qp.lbx = arg[5];
  d_qp.ubx = arg[6];
  d_qp.lba = arg[3];
