    d->arg[5] = d->lbdz;
    d->arg[6] = d->ubdz;
    d->arg[2] = d->Jk;
    d->arg[3] = d->lbdz+108;
    d->arg[4] = d->ubdz+108;
    d->res[0] = 0;
    d->res[1] = 0;
    d->res[2] = 0;
    d->res[3] = 0;
    d->res[0] = d->dx;
    d->res[3] = d->dlam;
    d->res[2] = d->dlam+108;
    ret = casadi_f8(d->arg, d->res, d->iw, d->w, 0);
